#adpd-title {
  color: white;
  font-size: 18pt;
  margin: 0 10px;
}
#adpd-content {
  flex: 1 1 auto;
  position: relative;
  overflow: hidden;
}
#adpd-footer {
  flex: 0 0 35px;
  background: #455a64;
  color: white;
  padding: 5px 15px;
  line-height: 25px;
}
#fg3d-container {
  height: 100% !important;
  max-height: 100%;
}
.fg3d-tagbox {
  cursor: pointer;
  text-align: right;
}
.fg3d-tagbox-dropbox {
  position: absolute;
  width: 170px;
  right: 0;
  background: #555;
  color: white;
  max-height: 200px;
  overflow: auto;
  border: 1px solid gray;
  box-shadow: 2px 2px 5px black;
  cursor: pointer;
  text-align: left;
}
.fg3d-tagbox-listitem {
  line-height: 20px;
  padding: 0 0 0 25px;
  margin: 6px;
  white-space: nowrap;
  overflow: hidden;
  text-overflow: ellipsis;
  background: transparent no-repeat;
}
.fg3d-tagbox-listitem.selected {
  background-image: url(data:image/svg+xml;charset=utf-8;base64,PHN2ZyB2ZXJzaW9uPSIxLjEiCiAgICAgd2lkdGg9IjUwIiBoZWlnaHQ9IjUwIgogICAgIHhtbG5zPSJodHRwOi8vd3d3LnczLm9yZy8yMDAwL3N2ZyI+CiAgICA8cGF0aCBkPSJNNSAyMEwyMCAzNUw0NSAxMCIgc3Ryb2tlPSIjMjE5NmYzIiBzdHJva2Utd2lkdGg9IjEwIiBmaWxsPSJub25lIi8+Cjwvc3ZnPgo=);
  background-size: contain;
}
.fg3d-tagbox-listitem:hover {
  opacity: 0.8;
}

#logo img {
  height: 49px;
  width: 144px !important;
  padding: 0;
  margin: 0;
}
.page-app-dataGraph2d #ribbon,
.page-app-dataGraph3d #ribbon,
.page-app-dataGraphVr #ribbon {
  display: none;
}
.page-app-dataGraph2d #content,
.page-app-dataGraph3d #content,
.page-app-dataGraphVr #content,
.page-app-dataGraph2d #content .well,
.page-app-dataGraph3d #content .well,
.page-app-dataGraphVr #content .well {
  padding: 0 !important;
  margin: 0 !important;
}
#fg3d-container {
  position: relative;
  width: 100%;
  height: calc(100vh - 78px);
  min-height: 100px;
}
#fg3d-container.is-fullscreen {
  position: absolute;
  height: 100%;
  background: black;
  /* try keep this color same as graph bg color */
}
body.menu-on-top #fg3d-container {
  height: calc(100vh - 152px);
}
@media (max-width: 979px) {
  #fg3d-container {
    height: calc(100vh - 90px);
  }
}
#fg3d-box.fg3d-type-vr,
#fg3d-container.is-fullscreen #fg3d-box {
  position: absolute;
  width: 100%;
  height: 100%;
}
#fg3d-box.fg3d-type-vr > div {
  height: 100%;
}
.fg3d-fullscreen-button {
  position: absolute;
  top: 5px;
  right: 5px;
}
#fg3d-infobox {
  position: absolute;
  top: 5px;
  right: 5px;
  padding: 6px;
  border-radius: 4px;
  width: 300px;
  max-width: 60%;
  max-height: 90%;
  overflow: auto;
  background: linear-gradient(90deg, #3c3c3c, black);
  border: 1px solid #3c3c3c;
  color: white;
}
.fg3d-tags-container {
  width: 170px;
}
.fg3d-tags-container .dx-tag-container {
  justify-content: flex-end;
}
.fg3d-tags-container .dx-tag {
  margin: 5px 0 0 5px;
}
.fg3d-tags-container .dx-tag-content {
  background-color: transparent !important;
  color: white !important;
  padding: 5px 22px 5px 5px;
  text-overflow: ellipsis;
  overflow: hidden;
  max-width: 120px;
  white-space: nowrap;
}
.fg3d-tags-container .dx-tag-remove-button {
  left: auto;
  right: 0;
}
.fg3d-entity-info {
  position: relative;
  border-top: 1px solid dimgrey;
}
.fg3d-info-icon {
  position: absolute;
  top: 10px;
  right: 0;
  width: 25px;
  height: 25px;
  display: flex;
  align-items: center;
}
.fg3d-info-name-p {
  margin-right: 30px;
}
.fg3d-filter-box {
  position: absolute;
  top: 5px;
  right: 5px;
  color: white;
}
.fg3d-filter-box.moved {
  right: 310px;
}
.fg3d-filter-box input {
  width: 100px;
  background: #3c3c3c;
  color: white;
  border: 1px solid gray;
}
#fg3d-highlight {
  position: absolute;
  bottom: 5px;
  right: 5px;
  color: white;
}
.fg3d-config-button {
  position: absolute;
  top: 5px;
  left: 5px;
  color: white;
  font-size: 150%;
  cursor: pointer;
}
.fg3d-config-box {
  position: absolute;
  top: 5px;
  left: 5px;
  color: white;
  z-index: 10;
}
.fg3d-config-box.open {
  background: linear-gradient(-90deg, #3c3c3c, black);
  border: 1px solid #3c3c3c;
  padding: 10px;
  overflow: auto;
  max-height: 90%;
  max-width: 60%;
}
.fg3d-config-box.open > .fg3d-config-icon {
  top: 2px;
  left: 2px;
}
.fg3d-config-box.open > .fg3d-config-form {
  display: block;
  margin-top: 25px;
}
.fg3d-config-box > .fg3d-config-icon {
  position: absolute;
  top: 3px;
  left: 3px;
  display: block;
  font-size: 160%;
  opacity: 0.7;
  cursor: pointer;
}
.fg3d-config-box > .fg3d-config-form {
  display: none;
}
.fg3d-config-box button {
  color: #3c3c3c;
  line-height: normal;
}
.fg3d-config-box .form-row {
  display: flex;
  justify-content: space-between;
  line-height: 22px;
  height: 22px;
  margin-bottom: 2px;
}
.fg3d-config-box .form-row.dis {
  color: gray;
}
.fg3d-config-box .form-row input {
  background-color: transparent;
  border-width: 1px;
  margin-left: 10px;
}
.fg3d-config-box .form-row .same-width {
  width: 135px;
}
.fg3d-legend-box {
  position: absolute;
  left: 10px;
  bottom: 10px;
  color: white;
  max-height: 90%;
  overflow: auto;
}
.fg3d-legend-box.open > .fg3d-legend-icon {
  display: none;
}
.fg3d-legend-box.open > .fg3d-legend-item {
  display: flex;
}
.fg3d-legend-icon {
  cursor: pointer;
}
.fg3d-legend-item {
  display: none;
}
.fg3d-leg-icon {
  flex: 0 0 25px;
  width: 25px;
  margin-right: 5px;
  display: flex;
  align-items: center;
}

/* .a-fullscreen means not embedded. */
html.a-fullscreen {
    bottom: 0;
    left: 0;
    position: fixed;
    right: 0;
    top: 0;
}

html.a-fullscreen body {
    height: 100%;
    margin: 0;
    overflow: hidden;
    padding: 0;
    width: 100%;
}

/* Class is removed when doing <a-scene embedded>. */
html.a-fullscreen .a-canvas {
    width: 100% !important;
    height: 100% !important;
    top: 0 !important;
    left: 0 !important;
    right: 0 !important;
    bottom: 0 !important;
    position: fixed !important;
}

html:not(.a-fullscreen) .a-enter-vr {
    right: 5px;
    bottom: 5px;
}

/* In chrome mobile the user agent stylesheet set it to white  */
:-webkit-full-screen {
    background-color: transparent;
}

.a-hidden {
    display: none !important;
}

.a-canvas {
    height: 100%;
    left: 0;
    position: absolute;
    top: 0;
    width: 100%;
}

.a-canvas.a-grab-cursor:hover {
    cursor: grab;
    cursor: -moz-grab;
    cursor: -webkit-grab;
}

canvas.a-canvas.a-mouse-cursor-hover:hover {
    cursor: pointer;
}

.a-inspector-loader {
    background-color: #ed3160;
    position: fixed;
    left: 3px;
    top: 3px;
    padding: 6px 10px;
    color: #fff;
    text-decoration: none;
    font-size: 12px;
    font-family: Roboto, sans-serif;
    text-align: center;
    z-index: 99999;
    width: 204px;
}

/* Inspector loader animation */
@keyframes dots-1 {
    from {
        opacity: 0;
    }
    25% {
        opacity: 1;
    }
}

@keyframes dots-2 {
    from {
        opacity: 0;
    }
    50% {
        opacity: 1;
    }
}

@keyframes dots-3 {
    from {
        opacity: 0;
    }
    75% {
        opacity: 1;
    }
}

@-webkit-keyframes dots-1 {
    from {
        opacity: 0;
    }
    25% {
        opacity: 1;
    }
}

@-webkit-keyframes dots-2 {
    from {
        opacity: 0;
    }
    50% {
        opacity: 1;
    }
}

@-webkit-keyframes dots-3 {
    from {
        opacity: 0;
    }
    75% {
        opacity: 1;
    }
}

.a-inspector-loader .dots span {
    animation: dots-1 2s infinite steps(1);
    -webkit-animation: dots-1 2s infinite steps(1);
}

.a-inspector-loader .dots span:first-child + span {
    animation-name: dots-2;
    -webkit-animation-name: dots-2;
}

.a-inspector-loader .dots span:first-child + span + span {
    animation-name: dots-3;
    -webkit-animation-name: dots-3;
}

a-scene {
    display: block;
    position: relative;
    height: 100%;
    width: 100%;
}

a-assets,
a-scene video,
a-scene img,
a-scene audio {
    display: none;
}

.a-enter-vr-modal,
.a-orientation-modal {
    font-family: Consolas, Andale Mono, Courier New, monospace;
}

.a-enter-vr-modal a {
    border-bottom: 1px solid #fff;
    padding: 2px 0;
    text-decoration: none;
    transition: .1s color ease-in;
}

.a-enter-vr-modal a:hover {
    background-color: #fff;
    color: #111;
    padding: 2px 4px;
    position: relative;
    left: -4px;
}

.a-enter-vr {
    font-family: sans-serif, monospace;
    font-size: 13px;
    width: 100%;
    font-weight: 200;
    line-height: 16px;
    position: absolute;
    right: 20px;
    bottom: 20px;
}

.a-enter-vr-button,
.a-enter-vr-modal,
.a-enter-vr-modal a {
    color: #fff;
}

.a-enter-vr-button:hover {
    background-color: #666;

[data-a-enter-vr-no-webvr] .a-enter-vr-button {
    border-color: #666;
    opacity: 0.65;

[data-a-enter-vr-no-webvr] .a-enter-vr-button:active,
[data-a-enter-vr-no-webvr] .a-enter-vr-button:hover {
    background-color: rgba(0, 0, 0, .35);
    cursor: not-allowed;

.a-enter-vr-modal {
    background-color: #666;
    border-radius: 0;
    display: none;
    min-height: 32px;
    margin-right: 70px;
    padding: 9px;
    width: 280px;
    right: 2%;
    position: absolute;
}

.a-enter-vr-modal:after {
    border-bottom: 10px solid transparent;
    border-left: 10px solid #666;
    border-top: 10px solid transparent;
    display: inline-block;
    content: '';
    position: absolute;
    right: -5px;
    top: 5px;
    width: 0;
    height: 0;
}

.a-enter-vr-modal p,
.a-enter-vr-modal a {
    display: inline;
}

.a-enter-vr-modal p {
    margin: 0;
}

.a-enter-vr-modal p:after {
    content: ' ';
}

[data-a-enter-vr-no-webvr].a-enter-vr:hover .a-enter-vr-modal,
[data-a-enter-vr-no-headset].a-enter-vr:hover .a-enter-vr-modal {
    display: block;
}

<body>
<div id="adpd-wrapper">
    <header id="adpd-header">
        <div id="adpd-logo"></div>
        <div id="adpd-title">Conceptant visualisation demo</div>
    </header>
    <div id="adpd-content">
        <div id='fg3d-container'>
            <div id="fg3d-box"></div>
            <div id="fg3d-config" class="fg3d-config-box">
                <div class='fg3d-config-icon fa fa-bars'></div>
                <div class="fg3d-config-form">
                    <div>
                        <div class='form-row'>Nodes filter:
                            <input id="fg3d-nodeFilter" class="same-width"/>
                        </div>
                        <div class='form-row'>Links filter:
                            <input id="fg3d-linkFilter" class="same-width"/>
                        </div>
                        <div class="form-row">Tags:
                            <div class="fg3d-tags-container same-width"></div>
                        </div>
                        <label class='form-row'>
                            Show labels for highlighted nodes
                            <input type='checkbox' id="fg3d-hlLabelNodes"/>
                        </label>
                        <label class='form-row'>
                            Show labels for highlighted links
                            <input type='checkbox' id="fg3d-hlLabelLinks"/>
                        </label>
                        <div class='form-row'>Highlight selected %:
                            <input type="number" id="fg3d-hlColorIntensity" class="same-width"/>
                        </div>
                        <div class='form-row'>Dim not selected %:
                            <input type="number" id="fg3d-hlDimIntensity" class="same-width"/>
                        </div>
                        <label class='form-row'>
                            Label all nodes [E]
                            <input type='checkbox' id="fg3d-labelNodes"/>
                        </label>
                        <label class='form-row'>
                            Label all links [R]
                            <input type='checkbox' id="fg3d-labelLinks"/>
                        </label>
                        <label class='form-row'>
                            Fix dragged nodes [X]
                            <input type='checkbox' id="fg3d-fixDragged"/>
                        </label>
                        <label class='form-row'>
                            Camera orbiting [O]
                            <input type='checkbox' id="fg3d-animCamera"/>
                        </label>
                        <div class="form-row">
                            <button id="fg3d-export-png">Export as PNG</button>
                        </div>
                        <div class='form-row'>Link curvature %:
                            <input type="number" id="fg3d-linkCurvature"/>
                        </div>
                        <div class='form-row'>Link distance % [+/-]:
                            <input type="number" id="fg3d-linkDistance"/>
                        </div>
                    </div>
                </div>
            </div>
            <div id="fg3d-legend" class="fg3d-legend-box"></div>
            <div id='fg3d-infobox'></div>
        </div>
    </div>
    <div id="adpd-footer">
        &copy; Conceptant 2020
    </div>
</div>
